import About from "./Components/About/About";
import BannerIntro from "./Components/BannerIntro/BannerIntro";
import Navbar from "./Components/Navbar/Navbar";
import Skills from "./Components/Skills/Skills";
import Partfolio from "./Components/Portfolio/Partfolio";
// import Contact from "./Components/Contact/Contact";
import Footer from "./Components/Footer/Footer";

function App() {
    const [isLoading, setIsLoading] = useState(false);

    const isLoadingHandler = () => {
      setTimeout(() => {
        setIsLoading(false);
      }, 10000);
    };

    useEffect(() => {
      isLoadingHandler();

      console.log(isLoading);
    }, []);

  return (
    <div className={`text-white scroll-smooth`}>
      <Navbar className="" />
      <BannerIntro />
      <div className="bg-image2 bg-cover -mt-1 scroll-smooth">
        <About />
        <Skills />
        <Partfolio />
      </div>
      {/* <Contact /> */}
      <Footer />
    </div>
  );
}

export default App;
